import React from "react";
import{Link} from "react-router-dom";
function Navbar(){
    return(
        <div class="hero">
            <p>
                <nav>
                    <ul>
                        <Link to="/home">Home</Link>
                        <Link to="/aboutus">AboutUs</Link>
                        <Link to="/contact">Contact</Link>
                        
                    </ul>
                </nav>
            </p>
        </div>    
    )
}
export default Navbar
